INSERT INTO `questions` (`id`, `question`, `testable_type`, `testable_id`, `subject_id`, `created_at`, `updated_at`) VALUES
(57, '<p>Model penulisan dan perancangan algoritma menggunakan simbol bangun ruang dalam mempresentasikan proses program disebut...</p>', 'pre-test', 7, 17, '2023-09-10 19:02:01', '2023-09-10 19:02:01'),
(58, '<p>Simbol yang mempresentasikan operasi yang dapat dilihat secara manual adalah</p>', 'pre-test', 7, 17, '2023-09-10 21:07:22', '2023-09-10 21:07:22'),
(59, '<p>Berikut ini kata kunci-kata kunci untuk menuliskan struktur-struktur yang digunakan dalam penyajian dengan pseudocode, kecuali ....</p>', 'pre-test', 7, 17, '2023-09-10 21:19:01', '2023-09-10 21:19:01'),
(60, '<p><em>Perhatikan petikan algoritma berikut :</em></p><p>Algoritma luas segitiga</p><p>1. Mulai</p><p>2. Masukkan tinggi</p><p>3. Masukkan alas</p><p>4. ...........</p><p>5. Tampilkan luas</p><p>6. Selesai</p><p><em>Langkah ke 4 adalah ...</em></p>', 'pre-test', 7, 17, '2023-09-10 21:26:44', '2023-09-10 21:26:44'),
(61, '<p>Simbol yang digunakan untuk menunjukkan arah aliran pada flowchart adalah&hellip;</p>', 'pre-test', 7, 17, '2023-09-10 21:32:00', '2023-09-10 21:32:00'),
(62, '<p><em>Diberikan potongan algoritma berikut</em></p><p>p=22</p><p>q=21</p><p>IF (p &gt; q) THEN</p><p>p=p-q</p><p>WRITE p</p><p><em>Keluaran dari algoritma di atas adalah .... </em></p>', 'course-test', 9, 17, '2023-09-10 21:40:43', '2023-09-10 21:40:43'),
(63, '<p><em>Algoritma Hitung</em></p><p>1) Baca masukkan x</p><p>2) Baca masukan y</p><p>3) Jika x lebih besar y maka lanjut ke langkah 4, jika tidak lanjut ke langkah 5</p><p>4) Ubah nilai x menjadi x dikurangi y, ulangi lagi langkah 3</p><p>5) Tuliskan x</p><p>6) Selesai</p><p><em>Tentukan output dari algoritma di atas jika dimasukkan nilai x adalah 29 dan y 10 adalah&hellip;</em></p>', 'course-test', 9, 17, '2023-09-10 21:44:24', '2023-10-17 07:10:47'),
