(99, '<p><strong>def list_sum(num_List):</strong></p><p><strong>&nbsp; &nbsp; &nbsp;if len(num_List) == 1:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return num_List[0]</strong></p><p><strong>&nbsp; &nbsp; &nbsp;else:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;return num_List[0]+list_sum(num_List[1:])</strong></p><p><strong><em>print</em>(list_sum(3,5,8,9,9]))</strong></p><p>berapakah output yang akan dihasilkan program?</p>', 'course-test', 11, 19, '2023-09-14 04:19:17', '2023-09-14 04:19:17'),
