(176, '<p><strong>mahasiswa = {<br />&nbsp; &#39;nama&#39;: &#39;Kukuh Cokro&#39;,<br />&nbsp; &#39;asal&#39;: &#39;Indonesia&#39;<br />}<br /><br />print (&#39;Nama : &#39;, mahasiswa.get(&#39;nama&#39;))<br />mahasiswa[&#39;nama&#39;] = &#39;Nuri Hidayatuloh&#39;<br />print(&#39;Nama : &#39;,mahasiswa.get(&#39;nama&#39;))</strong></p><p>Misalnya semua syntax <strong>mahasiswa.get(&lsquo;nama&rsquo;) </strong>diganti menjadi <strong>mahasiswa.get(&lsquo;asal&rsquo;) </strong>maka outputnya akan seperti apa?</p>', 'post-test', 7, 24, '2023-09-15 09:10:51', '2023-09-15 09:10:51'),
(177, '<p>Hasil output dari program di bawah ialah?</p><p><strong>dl={1:10,&nbsp;2:20,3:30,&nbsp;4:70,&nbsp;5:60,&nbsp;6:50,7:40}</strong></p><p><strong>dl.pop&nbsp;(6)</strong></p>', 'post-test', 7, 24, '2023-09-15 09:12:09', '2023-09-15 09:12:09'),
(178, '<p><strong>inventory&nbsp;=&nbsp;{&quot;laptop&quot;:&nbsp;15,&nbsp;&quot;tas&quot;:&nbsp;30,&nbsp;&quot;handphone&quot;:&nbsp;30,&nbsp;&quot;dompet&quot;:&nbsp;40}</strong></p><p><strong>inventory[&quot;tas&quot;]&nbsp;=&nbsp;50</strong></p><p><strong>inventory[&quot;laptop&quot;]&nbsp;=&nbsp;25</strong></p><p>Dari potongan program diatas, apa output yang akan ditampilkan?</p>', 'post-test', 7, 24, '2023-09-15 09:14:46', '2023-09-15 09:14:46'),
(179, '<p><strong>oscars&nbsp;=&nbsp;{&quot;Best&nbsp;Picture&quot;:&nbsp;&quot;Moonlight&quot;,&nbsp;&quot;Best&nbsp;Actor&quot;&nbsp;:&nbsp;&quot;Casey&nbsp;Affleck&quot;,&nbsp;&quot;Best&nbsp;Actress&quot;:&nbsp;&quot;Emma&nbsp;Stone&quot;,&nbsp;&quot;Animated&nbsp;Feature&quot;&nbsp;:&nbsp;&quot;Zootopia&quot;}</strong></p><p><strong>for&nbsp;element&nbsp;in&nbsp;oscars:</strong></p><p><strong>&nbsp;&nbsp;print&nbsp;(element)</strong></p><p>Apabila hanya ingin menampilkan isi dari nilai dari dictionary, maka menambahkan apa?</p>', 'post-test', 7, 24, '2023-09-15 09:16:56', '2023-09-15 09:16:56'),
