(209, '<p><strong>import re</strong></p><p><strong>find = r&quot;tidak&quot; </strong></p><p><strong>program = re.search(find, &quot;hariinitidakhujan&quot;) </strong></p><p><strong>if program: </strong></p><p><strong>&nbsp; &nbsp; &nbsp; print(program.span())</strong></p><p>Hasil output dari code diatas adalah &hellip;</p><p>&nbsp;</p>', 'course-test', 10, 18, '2023-09-24 06:50:22', '2023-09-24 06:50:22'),
(210, '<p>Sebuah expression biasanya terdiri dari &hellip;</p>', 'course-test', 10, 18, '2023-09-24 06:54:12', '2023-09-24 06:54:12'),
(211, '<p><strong>a = 50</strong></p><p><strong>b = 10</strong></p><p><strong>.....a .....b :</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Python 3&quot;)</strong></p><p><strong>....:</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Golang&quot;)</strong></p><p>Untuk menampilkan output Python 3, isi dari titik-titik secara berurutan di gambar adalah?</p>', 'course-test', 11, 19, '2023-09-24 07:06:06', '2023-09-24 07:06:06'),
(212, '<p><strong>a = 50</strong></p><p><strong>b = 10</strong></p><p><strong>.....a .....b :</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Python 3&quot;)</strong></p><p><strong>....:</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Golang&quot;)</strong></p><p>Apabila a = -7, untuk dapat menghasilkan output Golang pada program, isi dari titik-titik pada gambar yang tepat ialah?</p>', 'course-test', 11, 19, '2023-09-24 07:13:27', '2023-09-24 07:13:27'),
(213, '<p>Apakah output yang akan ditampilan program di bawah ini?</p><p><strong>a =&nbsp;<em>True</em></strong></p><p><strong>b = <em>False</em></strong></p><p><strong>c =&nbsp;<em>False</em></strong></p><p><strong>if a or (b and c):</strong></p><p><strong>&nbsp; &nbsp; &nbsp; <em>print</em>(&quot;UNIVERSITASTRUNOJOYOMADURA&quot;)</strong></p><p><strong>else:</strong></p><p><strong>&nbsp; &nbsp; &nbsp;&nbsp;<em>print</em>(&quot;universitastrunojoyomadura&quot;)</strong></p>', 'course-test', 11, 19, '2023-09-24 07:30:44', '2023-09-24 07:30:44'),
(214, '<p>Misalkan Anda memiliki dua variabel x dan y yang didefinisikan. Tulis pernyataan if untuk mengevaluasi apakah x lebih kecil dari y. Pernyataan tidak boleh melakukan apa pun, bahkan jika kondisinya benar.</p>', 'course-test', 11, 19, '2023-09-24 07:32:32', '2023-09-24 07:32:32'),
