(219, '<p><strong>def penjumlahan<em>(1,2)</em>;</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;return nilai1+nilai2</strong></p><p>&nbsp;</p><p><strong>print(penjumlahan(1,2))</strong></p><p>Perhatikan code diatas, apa nama object (1,2) bercetak miring yang tertera ada fungsi di atas?</p>', 'course-test', 12, 20, '2023-09-24 08:02:38', '2023-09-24 08:02:38'),
(220, '<p>Dari pendeklarasian function python di bawah ini, mana yang benar?</p>', 'course-test', 12, 20, '2023-09-24 08:04:45', '2023-09-24 08:04:45'),
(221, '<p>Loop akan terus menerus melakukan perulangan dan tidak bisa berhenti (kecuali diberhentikan paksa) ketika kondisinya tidak pernah bernilai &hellip;&hellip;.</p>', 'course-test', 13, 21, '2023-09-24 08:43:03', '2023-09-24 08:43:03'),
