(233, '<p><strong>kelas_matkul = [&nbsp;</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;[&quot;ALPRO&quot;, &quot;PTIK&quot;,&quot;PBO&quot;,&quot;PBW&quot;],</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;[&quot;F305&quot;,&quot;F304&quot;,&quot;F303&quot;,&quot;F302&quot;],</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;[&quot;SENIN&quot;,&quot;SELASA&quot;,&quot;RABU&quot;,&quot;KAMIS&quot;]</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;[&quot;07:00&quot;,&quot;09:30&quot;,&quot;12:00&quot;,&quot;15:30&quot;]</strong></p><p><strong>]</strong></p><p>Mana source code yang benar jika ingin menghapus data &ldquo;ALPRO&rdquo;?</p>', 'course-test', 15, 23, '2023-09-24 11:25:50', '2023-09-24 11:25:50'),
(234, '<p><strong>materi = [ &quot;variable&quot;,&quot;algoritma&quot;,&quot;perulangan&quot;]</strong></p><p><strong>nilai=[60,70,80]</strong></p><p>source code mana dari pilihan dibawah ini yang akan menghasilkan :</p><p><strong>variable : 60</strong></p><p><strong>algoritma : 70</strong></p><p><strong>Perulangan : 80</strong></p>', 'course-test', 15, 23, '2023-09-24 11:29:13', '2023-09-24 11:29:13'),
