(237, '<p>nilai = {&quot;Matematika&quot; : 4,</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &quot;Fisika&quot; : 3.8,</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &quot;Biologi&quot; : 3.9,</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&quot;Inggris&quot; : 4}</p><p>print (nilai[0])</p><p>Cuplikan kode diatas menghasilkan&hellip;.</p><p>&nbsp;</p>', 'course-test', 16, 24, '2023-09-24 11:37:48', '2023-09-24 11:37:48'),
(238, '<p><strong>grades = {&quot;logica engineering&quot; : 4,</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &quot;alpro&quot; : 3.8,</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &quot;PTIK&quot; : 3.7 }</strong></p><p><strong>list(grades.keys()) [2] [2]</strong></p><p>Apabila ingin menampilkan huruf &ldquo;o&rdquo;, maka mengganti kode baris keempat menjadi &hellip;</p>', 'course-test', 16, 24, '2023-09-24 11:43:22', '2023-09-24 11:43:22'),
(239, '<p><strong>grades = {&quot;logica engineering&quot; : 4,</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &quot;alpro&quot; : 3.8,</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &quot;PTIK&quot; : 3.7 }</strong></p><p><strong>list(grades.keys()) [2] [2]</strong></p><p>Apabila jika kode baris 4 diganti dengan <strong>list(grades.values())[1][1], </strong>Maka hasil output pada program adalah</p>', 'course-test', 16, 24, '2023-09-24 11:45:04', '2023-09-24 11:45:04'),
(240, '<p><strong>mahasiswa = {</strong></p><p><strong>&nbsp; &nbsp;&#39;nama&#39; : &#39;Kukuh Cokro&#39;,</strong></p><p><strong>&nbsp; &nbsp;&#39;asal&#39;&nbsp; &nbsp; : &#39;Indonesia&#39;</strong></p><p><strong>}</strong></p><p><strong>print (&#39;Nama:&#39;,mahasiswa.get(&#39;nama&#39;))</strong></p><p><strong>mahasiswa[&#39;nama&#39;] = &#39;Nuri Hidayatuloh&#39;</strong></p><p><strong>print(&#39;Nama:&#39;,mahasiswa.get(&#39;nama&#39;))&nbsp;</strong></p><p>Misalnya semua syntax <strong>mahasiswa.get(&lsquo;nama&rsquo;) </strong>diganti menjadi <strong>mahasiswa.get(&lsquo;asal&rsquo;) </strong>maka outputnya akan seperti apa?</p>', 'course-test', 16, 24, '2023-09-24 11:50:40', '2023-09-24 11:50:40'),
