(318, '<p><strong>def list_sum(num_List):</strong></p><p><strong>&nbsp; &nbsp; &nbsp;if len(num_List) == 1:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return num_List[0]</strong></p><p><strong>&nbsp; &nbsp; &nbsp;else:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;return num_List[0]+list_sum(num_List[1:])</strong></p><p><strong><em>print</em>(list_sum(3,5,8,9,9]))</strong></p><p>berapakah output yang akan dihasilkan program?</p>', 'course-test', 20, 28, '2023-09-27 06:15:11', '2023-09-27 06:15:11'),
(319, '<p><strong>a = 50</strong></p><p><strong>b = 10</strong></p><p><strong>.....a .....b :</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Python 3&quot;)</strong></p><p><strong>....:</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Golang&quot;)</strong></p><p>Untuk menampilkan output Python 3, isi dari titik-titik secara berurutan di gambar adalah?</p>', 'course-test', 20, 28, '2023-09-27 06:17:57', '2023-09-27 06:17:57'),
(321, '<p><strong>a = 50</strong></p><p><strong>b = 10</strong></p><p><strong>.....a .....b :</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Python 3&quot;)</strong></p><p><strong>....:</strong></p><p><strong>&nbsp; &nbsp; print(&quot;Golang&quot;)</strong></p><p>Apabila a = -7, untuk dapat menghasilkan output Golang pada program, isi dari titik-titik pada gambar yang tepat ialah?</p>', 'course-test', 20, 28, '2023-09-27 06:29:07', '2023-09-27 06:29:07'),
