(369, '<p><strong>mahasiswa = {</strong></p><p><strong>&nbsp; &nbsp;&#39;nama&#39; : &#39;Kukuh Cokro&#39;,</strong></p><p><strong>&nbsp; &nbsp;&#39;asal&#39;&nbsp; &nbsp; : &#39;Indonesia&#39;</strong></p><p><strong>}</strong></p><p><strong>print (&#39;Nama:&#39;,mahasiswa.get(&#39;nama&#39;))</strong></p><p><strong>mahasiswa[&#39;nama&#39;] = &#39;Nuri Hidayatuloh&#39;</strong></p><p><strong>print(&#39;Nama:&#39;,mahasiswa.get(&#39;nama&#39;))&nbsp;</strong></p><p>Misalnya semua syntax&nbsp;<strong>mahasiswa.get(&lsquo;nama&rsquo;)&nbsp;</strong>diganti menjadi&nbsp;<strong>mahasiswa.get(&lsquo;asal&rsquo;)&nbsp;</strong>maka outputnya akan seperti apa?</p>', 'course-test', 25, 33, '2023-09-27 09:21:08', '2023-09-27 09:21:08'),
