(371, '<p><strong>grades&nbsp;=&nbsp;{&nbsp;&quot;Logica&nbsp;Engineering&quot;&nbsp;:&nbsp;4,</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&quot;Alpro&quot;&nbsp;:&nbsp;3.8,</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&quot;PTIK&quot;&nbsp;:&nbsp;3.7&nbsp;}</strong></p><p><strong>list(grades.keys())&nbsp;[2][2]</strong></p><p>Hasil dari program diatas adalah</p>', 'course-test', 25, 33, '2023-09-27 09:25:09', '2023-09-27 09:25:09'),
(372, '<p><strong>oscars&nbsp;=&nbsp;{&quot;Best&nbsp;Picture&quot;:&nbsp;&quot;Moonlight&quot;,&nbsp;&quot;Best&nbsp;Actor&quot;&nbsp;:&nbsp;&quot;Casey&nbsp;Affleck&quot;,&nbsp;&quot;Best&nbsp;Actress&quot;:&nbsp;&quot;Emma&nbsp;Stone&quot;,&nbsp;&quot;Animated&nbsp;Feature&quot;&nbsp;:&nbsp;&quot;Zootopia&quot;}</strong></p><p><strong>for&nbsp;element&nbsp;in&nbsp;oscars:</strong></p><p><strong>&nbsp; &nbsp; &nbsp;print&nbsp;(element)</strong></p><p>Output dari program diatas adalah</p><p>&nbsp;</p>', 'course-test', 25, 33, '2023-09-27 09:27:03', '2023-09-27 09:27:03'),
