(386, '<p>Lengkapilah pernyataan algoritma berikut, Input &gt; &hellip;&hellip; &nbsp;&gt; Komputer &gt; Solusi / hasil.</p><p>Untuk melengkapi pernyataan diatas adalah . .</p>', 'post-test', 8, 26, '2023-09-27 10:07:07', '2023-09-27 10:07:07'),
