(389, '<p><em>Algoritma Hitung</em></p><p>&nbsp;</p><p>1) Baca masukkan x</p><p>2) Baca masukan y</p><p>3) Jika x lebih besar y maka lanjut ke langkah 4, jika tidak lanjut ke langkah 5</p><p>4) Ubah nilai x menjadi x dikurangi y, ulangi lagi langkah 3</p><p>5) Tuliskan a</p><p>6) Selesai</p><p>&nbsp;</p><p><em>Tentukan output dari algoritma di atas jika dimasukkan nilai x adalah 29 dan y 10 adalah&hellip;</em></p>', 'post-test', 8, 26, '2023-09-27 10:13:05', '2023-09-27 10:13:05'),
(390, '<p>Instruksi X=Y akan mengakibatkan nilai X = nilaiY,dan nilai y menjadi :</p>', 'post-test', 8, 26, '2023-09-27 10:14:35', '2023-09-27 10:14:35'),
(391, '<p><strong>a = 20</strong></p><p><strong>b = 5</strong></p><p><strong>if a == b:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; print(f&quot;sebuah string {1 + 2} huruf&quot;)</strong></p><p><strong>else :</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;fungsi_ex = lambda x, y, z, : (x-y)*z</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;print(fungsi_ex(5,7,4))</strong></p><p>Hasil output dari kode program diatas adalah?</p>', 'post-test', 8, 27, '2023-09-27 10:18:46', '2023-09-27 10:18:46'),
(392, '<p>Berapakah nilai Python Ekspression dari 22%3?</p>', 'post-test', 8, 27, '2023-09-27 10:19:36', '2023-09-27 10:19:36'),
