(394, '<p>Hasil Output dari program dibawah yaitu?</p><p><strong>fungsi_2 = lambda x, y, z : x + y * z</strong></p><p><strong>print(fungsi_2(4,8,2))</strong></p>', 'post-test', 8, 27, '2023-09-27 10:21:54', '2023-09-27 10:21:54'),
(395, '<p><strong>def add(a,b):</strong></p><p><strong>&nbsp; &nbsp; &nbsp;return a - b</strong></p><p><strong>operation = lambda a, b : a * b</strong></p><p><strong>add(1,2)</strong></p><p><strong>operation(4,5)</strong></p><p>Apabila jika&nbsp;<strong>operation(4,5)</strong>&nbsp;dihapus, maka ketika program dijalankan output yang dihasilkan yaitu ..</p>', 'post-test', 8, 27, '2023-09-27 10:23:02', '2023-09-27 10:23:02'),
(396, '<p><strong>x = 41</strong></p><p><strong>if x&gt;10:</strong></p><p><strong>&nbsp; &nbsp;&nbsp;<em>print</em>(&quot;Algoritma:&quot;)</strong></p><p><strong>&nbsp; &nbsp; &nbsp;if x&gt;20:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<em>print</em>(&quot;dan Pemrograman)</strong></p><p><strong>&nbsp; &nbsp; &nbsp;else:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<em>print</em>(&quot;aku suka bahasa python&quot;)</strong></p><p>Jika x = 15, Outputnya adalah?</p>', 'post-test', 8, 28, '2023-09-27 10:24:31', '2023-09-27 10:24:31'),
(397, '<p><strong>x = 41</strong></p><p><strong>if x&gt;10:</strong></p><p><strong>&nbsp; &nbsp;&nbsp;<em>print</em>(&quot;Algoritma:&quot;)</strong></p><p><strong>&nbsp; &nbsp; &nbsp;if x&gt;20:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<em>print</em>(&quot;dan Pemrograman)</strong></p><p><strong>&nbsp; &nbsp; &nbsp;else:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<em>print</em>(&quot;aku suka bahasa python&quot;)</strong></p><p>&nbsp;</p><p>Output code tersebut adalah?</p>', 'post-test', 8, 28, '2023-09-27 10:25:44', '2023-09-27 10:25:44'),
(398, '<p><strong>num1 = 49</strong></p><p><strong>if num1 &gt; 80:</strong></p><p><strong>&nbsp; &nbsp; &nbsp;<em>print</em>&quot;output A&quot;)</strong></p><p><strong>elif num1 &lt; 50:</strong></p><p><strong>&nbsp; &nbsp; &nbsp;<em>print</em>(&quot;output B&quot;)</strong></p><p><strong>elif num1 &lt;= 80 or num1 &gt;= 50:<br />&nbsp; &nbsp; &nbsp;<em>print</em>(&quot;output C&quot;)</strong></p><p><strong>else :<br />&nbsp; &nbsp; &nbsp;<em>print</em>(&quot;output D&quot;)</strong></p><p>Terdapat variable baru pada program yaitu num3= 15 dan num2 = 55. Apabila num1 = num2+num3, maka hasil Output dari program ialah&hellip;</p>', 'post-test', 8, 28, '2023-09-27 10:27:07', '2023-09-27 10:27:07');
