(419, '<p><strong>materi = [&#39;variable&quot;, &quot;algoritma&quot;, &quot;perulangan&quot;]</strong></p><p><strong>nilai = [60,70,80]</strong></p><p><strong>for x in range (0,2):</strong></p><p><strong>&nbsp; &nbsp; &nbsp;if x != 0:</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; print(materi[x])</strong></p><p>Jika source code diatas di run makan menghasilkan output?</p>', 'post-test', 8, 32, '2023-09-27 11:46:46', '2023-09-27 11:46:46'),
(420, '<p>Function mana yang bukan untuk menghapus atau mengosongkan isi list?</p><p>&nbsp;</p>', 'post-test', 8, 32, '2023-09-27 11:47:53', '2023-09-27 11:47:53'),
(421, '<p><strong>oscars&nbsp;=&nbsp;{&quot;Best&nbsp;Picture&quot;:&nbsp;&quot;Moonlight&quot;,&nbsp;&quot;Best&nbsp;Actor&quot;&nbsp;:&nbsp;&quot;Casey&nbsp;Affleck&quot;,&nbsp;&quot;Best&nbsp;Actress&quot;:&nbsp;&quot;Emma&nbsp;Stone&quot;,&nbsp;&quot;Animated&nbsp;Feature&quot;&nbsp;:&nbsp;&quot;Zootopia&quot;}</strong></p><p><strong>for&nbsp;element&nbsp;in&nbsp;oscars:</strong></p><p><strong>&nbsp;&nbsp;print&nbsp;(element)</strong></p><p>Apabila hanya ingin menampilkan isi dari nilai dari dictionary, maka menambahkan apa?</p>', 'post-test', 8, 33, '2023-09-27 11:49:37', '2023-09-27 11:49:37'),
(422, '<p><strong>inventory&nbsp;=&nbsp;{&quot;laptop&quot;:&nbsp;15,&nbsp;&quot;tas&quot;:&nbsp;30,&nbsp;&quot;handphone&quot;:&nbsp;30,&nbsp;&quot;dompet&quot;:&nbsp;40}</strong></p><p><strong>inventory[&quot;tas&quot;]&nbsp;=&nbsp;50</strong></p><p><strong>inventory[&quot;laptop&quot;]&nbsp;=&nbsp;25</strong></p><p>Dari potongan program diatas, apa output yang akan ditampilkan?</p>', 'post-test', 8, 33, '2023-09-27 11:50:41', '2023-09-27 11:50:41'),
(423, '<p>Hasil output dari program di bawah ialah?</p><p><strong>dl={1:10,&nbsp;2:20,3:30,&nbsp;4:70,&nbsp;5:60,&nbsp;6:50,7:40}</strong></p><p><strong>dl.pop&nbsp;(6)</strong></p>', 'post-test', 8, 33, '2023-09-27 11:51:41', '2023-09-27 11:51:41'),
(424, '<p><strong>mahasiswa = {<br />&nbsp; &#39;nama&#39;: &#39;Kukuh Cokro&#39;,<br />&nbsp; &#39;asal&#39;: &#39;Indonesia&#39;<br />}<br /><br />print (&#39;Nama : &#39;, mahasiswa.get(&#39;nama&#39;))<br />mahasiswa[&#39;nama&#39;] = &#39;Nuri Hidayatuloh&#39;<br />print(&#39;Nama : &#39;,mahasiswa.get(&#39;nama&#39;))</strong></p><p>Misalnya semua syntax&nbsp;<strong>mahasiswa.get(&lsquo;nama&rsquo;)&nbsp;</strong>diganti menjadi&nbsp;<strong>mahasiswa.get(&lsquo;asal&rsquo;)&nbsp;</strong>maka outputnya akan seperti apa?</p>', 'post-test', 8, 33, '2023-09-27 11:52:50', '2023-09-27 11:52:50'),
(425, '<p>Dibawah ini merupakan tipe data apa?</p><p><strong>Answer = {&ldquo;Apakah kamu ada di kampus?&rdquo;:&rdquo;ya&rdquo;,</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&ldquo;Apakah kamu masih maba?&rdquo;:&rdquo;Iya&rdquo;}</strong></p>', 'post-test', 8, 33, '2023-09-27 11:54:07', '2023-09-27 11:54:07'),
(426, '<p><strong>tup = (&quot;a&quot;,&quot;l&quot;,&quot;p&quot;,&quot;r&quot;,&quot;o&quot;.&quot;t&quot;.&quot;u&quot;,&quot;p&quot;,&quot;l&quot;,&quot;e&quot;)</strong></p><p><strong>print(&#39;a&#39; not in tuple)</strong></p><p>Output dari source code diatas adalah?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', 'post-test', 8, 34, '2023-09-27 11:55:27', '2023-09-27 11:55:27'),
(427, '<p><strong>tup = (&quot;a&quot;,&quot;l&quot;,&quot;p&quot;,&quot;r&quot;,&quot;o&quot;.&quot;t&quot;.&quot;u&quot;,&quot;p&quot;,&quot;l&quot;,&quot;e&quot;)</strong></p><p><strong>print(&#39;b&#39; in tup)</strong></p><p>Output dari source code diatas adalah?</p>', 'post-test', 8, 34, '2023-09-27 11:56:46', '2023-09-27 11:56:46'),
(428, '<p>berikut ini yang bisa dilakukan pada value / nilai Tuple di python, kecuali..</p>', 'post-test', 8, 34, '2023-09-27 11:58:14', '2023-09-27 11:58:14'),
(429, '<p><strong>tup = (&quot;a&quot;,&quot;l&quot;,&quot;p&quot;,&quot;r&quot;,&quot;o&quot;.&quot;t&quot;.&quot;u&quot;,&quot;p&quot;,&quot;l&quot;,&quot;e&quot;)</strong></p><p><strong>tup[9]=&quot;s&quot;</strong></p><p>Output dari source code diatas adalah?</p><p>&nbsp;</p>', 'post-test', 8, 34, '2023-09-27 11:59:27', '2023-09-27 11:59:27'),
(430, '<p><strong>tup = (&quot;a&quot;,&quot;l&quot;,&quot;p&quot;,&quot;r&quot;,&quot;o&quot;.&quot;t&quot;.&quot;u&quot;,&quot;p&quot;,&quot;l&quot;,&quot;e&quot;)</strong></p><p><strong>tup.index(&quot;e&quot;)</strong></p><p>output dari sourcecode diatas adalah?</p>', 'post-test', 8, 34, '2023-09-27 12:00:43', '2023-09-27 12:00:43');
